import React from "react";
import { Link, Outlet } from "react-router-dom";

class Header extends React.Component {
	rende() {
		return (
			<>
				<header>
					<Link to="/">Home</Link>
					<Link to="/login">Login</Link>
					<Link to="/main">Main</Link>
				</header>
				<Outlet />
			</>
		)
	}
}
export { Header }
